import React from "react";

export const Detail_Image_Section = (props) => {

    const photo_dispenser = (input) => {

        switch(typeof input){
            case('object'):
            console.log(input[0].getUrl())
            return <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent:'start',
                        width:'70vw',
                        overflow: 'scroll',
                        aspectRatio: '1'
                    }}
                    >

                        {input.map((element)=>{
                        return <img
                        style={{
                            
                            objectFit: 'scale-down'
                            }}
                        src={element.getUrl()}
                        >
                        </img>
                        })}

                </div>

            case('undefined'):
            return;
        }

    }

    return <React.Fragment>

    {photo_dispenser(props.photos)}

    </React.Fragment>

}

export default Detail_Image_Section
